// fitss
bool Bitpack_fitss(int64_t n, unsigned width) {
    if (width >= 64) return true;
    int64_t lo = -(int64_t)((uint64_t)1 << (width - 1));
    int64_t hi = ((int64_t)1 << (width - 1)) - 1;
